import React from 'react';
import { Link } from 'react-router-dom';
import { Box, AppBar, Toolbar, Container, Avatar, Typography, Menu, MenuItem } from '@mui/material';

const pages = ['Home', 'Menu', 'Reservation', 'Contact', 'My Account'];

const NavBar = () => {
  const [anchorElNav, setAnchorElNav] = React.useState(null);

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  return (
    <AppBar position="static" sx={{ backgroundColor: 'transparent'}}>
      <Container maxWidth="xl">
        <Toolbar>
          <Link to="/" style={{ textDecoration : 'none'}}>
            <Avatar 
                alt="Logo" 
                src={`logo.png`} 
                sx={{ width: '6rem', paddingTop: '1rem'}}
            />
            <Typography
              sx={{ 
                color: 'black',
                fontSize: '0.7rem',
                fontFamily: 'Knewave',
              }}
            >
              RELAXING KOALA
            </Typography>
          </Link>
          <Box>
            <Menu
              anchorEl={anchorElNav}
              open={Boolean(anchorElNav)}
              onClose={handleCloseNavMenu}
            >
              {pages.map((page) => (
                <MenuItem key={page} onClick={handleCloseNavMenu}>
                  <div style={{ textAlign: 'center' }}>{page}</div>
                </MenuItem>
              ))}
            </Menu>
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
}

export default NavBar;
